//SMART CONTRACT CODE

// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

contract Questionpaper{
    
     enum PaperStatus { ASSIGNED,UPLOADED }
     enum Role { Teacher, Superintendent, Center }

    struct User {
        uint256 id;
        string name;
        Role role;
        string email;
        string contactNumber;
        bool exists;
    }

     struct Paper{
        string fileCid;
        string fileType;
        string description;
        uint256 size;
        PaperStatus status;
        bool exists;
    }

   mapping(address => User) private users;
   mapping(address => bool) private superintendents;
   mapping(address => bool) private teachers;
   mapping(address => bool) private centers;
   mapping(string => Paper) private papers; //paperid->paper mapping
   mapping(string => address) private AssignedTeacher; //paperid->teacheraddress

    address[] private userList;
    address public examController;
    uint256 private userCount;

    
    modifier onlyExamController() {
        require(msg.sender == examController, "Only examController can perform this action");
        _;
    }
    
    constructor() {
        examController = msg.sender;
    }

    function registerUser(address _userAddress, string memory _name, Role _role, string memory _email, string memory _contactNumber) public onlyExamController {
        require(!users[_userAddress].exists, "User already registered");
        users[_userAddress] = User(++userCount, _name, _role, _email, _contactNumber, true);
        userList.push(_userAddress);
        if(_role == Role.Teacher){
             teachers[_userAddress]=true;
        }
        else if(_role == Role.Superintendent){
             superintendents[_userAddress]=true;
        }
        else{
            centers[_userAddress]=true;
        }
    }

    function getUser(address _userAddress) public view returns (uint256, string memory, Role, string memory, string memory) {
        require(users[_userAddress].exists, "User not found");
        User memory user = users[_userAddress];
        return (user.id, user.name, user.role, user.email, user.contactNumber);
    }

    function getAllUsers() public view returns (address[] memory) {
        return userList;
    }

    
    function removeUser(address _userAddress) public onlyExamController {
        require(users[_userAddress].exists, "User not found");
        delete users[_userAddress];
        if (teachers[_userAddress]) delete teachers[_userAddress];
        if (superintendents[_userAddress]) delete superintendents[_userAddress];
        if (centers[_userAddress]) delete centers[_userAddress];
    }

 function raisePaperRequest(
        string memory _paperId, 
        string memory _fileCid, 
        string memory _fileType, 
        string memory _description, 
        uint256 _size, 
        address _teacher
    ) public onlyExamController {
        require(!papers[_paperId].exists, "Paper already exists");
        require(teachers[_teacher], "Teacher not registered");

        papers[_paperId] = Paper({
            fileCid: _fileCid,
            fileType: _fileType,
            description: _description,
            size: _size,
            status: PaperStatus.ASSIGNED,
            exists: true
        });

        AssignedTeacher[_paperId] = _teacher;
    }

}
